import * as React from 'react'
import Card from '../components/Card/Card'
import Footer from '../components/Footer/Footer'
import { useParams } from 'react-router-dom'

function Location({title}) {
   const { id } = useParams()
    return (
        <div>
            <Card>
                {title}
            </Card>
            <Footer/>
        </div>
    )
}

export default Location
